<!DOCTYPE html>
<html lang="zh-CN">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>字符渲染工具</title>
    <style>
        :root {
            --bg-dark: #1a1a1a;
            --card-bg: #2d2d2d;
            --text-light: #f0f0f0;
            --border-color: #444;
            --accent-color: #4a8eff;
        }

        body {
            margin: 0;
            padding: 20px;
            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
            background-color: var(--bg-dark);
            color: var(--text-light);
            line-height: 1.6;
        }

        .container {
            max-width: 1000px;
            margin: 0 auto;
        }

        h1 {
            text-align: center;
            margin-bottom: 30px;
            color: var(--accent-color);
        }

        .panel {
            display: flex;
            flex-wrap: wrap;
            gap: 20px;
            margin-bottom: 20px;
        }

        .input-section {
            flex: 1;
            min-width: 300px;
            background: var(--card-bg);
            padding: 20px;
            border-radius: 8px;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
        }

        .preview-section {
            flex: 1;
            min-width: 300px;
            background: var(--card-bg);
            padding: 20px;
            border-radius: 8px;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
            display: flex;
            flex-direction: column;
        }

        .form-group {
            margin-bottom: 15px;
        }

        label {
            display: block;
            margin-bottom: 5px;
            font-weight: 500;
        }

        textarea,
        input[type="number"],
        input[type="text"] {
            width: 100%;
            padding: 10px;
            border: 1px solid var(--border-color);
            border-radius: 4px;
            background-color: #3c3c3c;
            color: var(--text-light);
            box-sizing: border-box;
        }

        textarea {
            min-height: 120px;
            resize: vertical;
        }

        .color-inputs {
            display: flex;
            flex-direction: column;
            gap: 10px;
        }

        .color-input {
            flex: 1;
        }

        .color-picker-container {
            display: flex;
            align-items: center;
            gap: 10px;
            margin-top: 5px;
        }

        .color-preview {
            width: 30px;
            height: 30px;
            border-radius: 4px;
            border: 1px solid var(--border-color);
        }

        button {
            background-color: var(--accent-color);
            color: white;
            border: none;
            padding: 10px 15px;
            border-radius: 4px;
            cursor: pointer;
            font-weight: bold;
            transition: background-color 0.2s;
        }

        button:hover {
            background-color: #3a7aed;
        }

        .download-btn {
            margin-top: 15px;
            background-color: #28a745;
        }

        .download-btn:hover {
            background-color: #218838;
        }

        canvas {
            image-rendering: pixelated;
            width: 100%;
            margin-top: 10px;
            border: 1px solid var(--border-color);
        }

        .canvas-container {
            position: relative;
            flex-grow: 1;
            display: flex;
            justify-content: center;
            align-items: center;
            min-height: 300px;
        }
    </style>
</head>

<body>
    <div class="container">
        <h1>字符渲染工具</h1>

        <div class="panel">
            <div class="input-section">
                <div class="form-group">
                    <label for="text-input">文本内容</label>
                    <textarea id="text-input" placeholder="请输入要渲染的文本..."></textarea>
                </div>

                <div class="form-group">
                    <label for="max-chars">每行字符数</label>
                    <input type="number" id="max-chars" value="16" min="1">
                </div>

                <div class="form-group">
                    <label>颜色设置</label>
                    <div class="color-inputs">
                        <div class="color-input">
                            <label for="foreground-color">前景色</label>
                            <div class="color-picker-container">
                                <input type="color" id="foreground-color" value="#ffffff">
                                <div class="color-preview" id="foreground-preview"></div>
                                <input type="range" id="foreground-alpha" min="0" max="1" step="0.01" value="1">
                                <span id="foreground-alpha-value">100%</span>
                            </div>
                        </div>
                        <div class="color-input">
                            <label for="background-color">背景色</label>
                            <div class="color-picker-container">
                                <input type="color" id="background-color" value="#000000">
                                <div class="color-preview" id="background-preview"></div>
                                <input type="range" id="background-alpha" min="0" max="1" step="0.01" value="1">
                                <span id="background-alpha-value">100%</span>
                            </div>
                        </div>
                    </div>
                </div>

                <button id="render-btn">渲染</button>
            </div>

            <div class="preview-section">
                <h3>预览</h3>
                <div class="canvas-container">
                    <canvas id="render-canvas"></canvas>
                </div>
                <button id="download-btn" class="download-btn">下载图像</button>
            </div>
        </div>
    </div>

        const font = fetch(fontData).then(
            r => r.arrayBuffer()
        ).then(buffer => {
            const glyphs = new Uint8Array(buffer.slice(2));

            // 获取DOM元素
            const textInput = document.getElementById('text-input');
            const maxCharsInput = document.getElementById('max-chars');
            const foregroundColorInput = document.getElementById('foreground-color');
            const foregroundAlphaInput = document.getElementById('foreground-alpha');
            const foregroundAlphaValue = document.getElementById('foreground-alpha-value');
            const foregroundPreview = document.getElementById('foreground-preview');
            const backgroundColorInput = document.getElementById('background-color');
            const backgroundAlphaInput = document.getElementById('background-alpha');
            const backgroundAlphaValue = document.getElementById('background-alpha-value');
            const backgroundPreview = document.getElementById('background-preview');
            const renderBtn = document.getElementById('render-btn');
            const downloadBtn = document.getElementById('download-btn');
            const canvas = document.getElementById('render-canvas');
            const ctx = canvas.getContext('2d');


            // 初始化示例文本
            textInput.value = "这是一个字符渲染示例\n您可以输入任何文本\n并调整参数进行渲染";

            // 更新颜色预览
            function updateColorPreview() {
                const fgColor = foregroundColorInput.value;
                const fgAlpha = foregroundAlphaInput.value;
                foregroundPreview.style.backgroundColor = fgColor;
                foregroundPreview.style.opacity = fgAlpha;
                foregroundAlphaValue.textContent = Math.round(fgAlpha * 100) + '%';

                const bgColor = backgroundColorInput.value;
                const bgAlpha = backgroundAlphaInput.value;
                backgroundPreview.style.backgroundColor = bgColor;
                backgroundPreview.style.opacity = bgAlpha;
                backgroundAlphaValue.textContent = Math.round(bgAlpha * 100) + '%';
            }

            // 将hex颜色和alpha值转换为rgba字符串
            function getRgbaFromHex(hex, alpha) {
                const r = parseInt(hex.slice(1, 3), 16);
                const g = parseInt(hex.slice(3, 5), 16);
                const b = parseInt(hex.slice(5, 7), 16);
                return `rgba(${r}, ${g}, ${b}, ${alpha})`;
            }

            function drawChar(char, x, y, color) {
                const ord = char.charCodeAt(0);
                const glyph = glyphs.slice(ord * 8, ord * 8 + 8);

                ctx.fillStyle = color;
                for (let row = 0; row < 8; row++) {
                    const bits = glyph[row];
                    for (let col = 0; col < 8; col++) {
                        if (bits & (0x80 >> col)) {
                            ctx.fillRect(x + col, y + row, 1, 1);
                        }
                    }
                }
            }

            // 渲染函数（由用户实现）
            function render(text, maxchars, foreground, background) {
                let x = 0;
                let y = 0;

                let maxWidth = maxchars * 8;
                let coords = [];
                for (let char of text) {
                    if (char === '\n') {
                        x = 0;
                        y += 8;
                        continue
                    } else if (char === '\r') {
                        x = 0;
                        continue
                    }
                    coords.push({ x, y, char });
                    if (char.charCodeAt(0) > 127) {
                        // 处理非ASCII字符
                        x += 8;
                    } else {
                        // 处理ASCII字符
                        x += 5;
                    }

                    if (x >= maxWidth - 7) {
                        x = 0;
                        y += 8;
                    }
                }

                // 计算至少需要的宽高
                let minWidth = 0;
                let minHeight = 0;
                for (let { x, y } of coords) {
                    if (y > minHeight) minHeight = y;
                }
                canvas.width = maxchars * 8;
                canvas.height = minHeight + 8;
                ctx.fillStyle = background;
                ctx.fillRect(0, 0, canvas.width, canvas.height);

                for (let { x, y, char } of coords) {
                    drawChar(char, x, y, foreground);
                }
            }

            // 更新Canvas大小并执行渲染
            function updateAndRender() {
                const text = textInput.value;
                const maxchars = parseInt(maxCharsInput.value) || 16;

                // 获取颜色值
                const fgColor = foregroundColorInput.value;
                const fgAlpha = foregroundAlphaInput.value;
                const bgColor = backgroundColorInput.value;
                const bgAlpha = backgroundAlphaInput.value;

                const foreground = getRgbaFromHex(fgColor, fgAlpha);
                const background = getRgbaFromHex(bgColor, bgAlpha);

                // 设置Canvas大小（根据文本行数和字符数）
                const lines = Math.ceil(text.length / maxchars);
                canvas.width = maxchars * 16; // 假设每个字符约16像素宽
                canvas.height = lines * 20 + 40; // 每行约20像素高，加一些边距

                // 调用渲染函数
                render(text, maxchars, foreground, background);
            }

            // 下载Canvas内容为图片
            function downloadCanvas() {
                const link = document.createElement('a');
                link.download = 'character-render.png';
                link.href = canvas.toDataURL('image/png');
                link.click();
            }

            // 事件监听
            renderBtn.addEventListener('click', updateAndRender);
            downloadBtn.addEventListener('click', downloadCanvas);

            // 颜色选择器事件
            foregroundColorInput.addEventListener('input', updateColorPreview);
            foregroundAlphaInput.addEventListener('input', updateColorPreview);
            backgroundColorInput.addEventListener('input', updateColorPreview);
            backgroundAlphaInput.addEventListener('input', updateColorPreview);

            // 初始更新和渲染
            updateColorPreview();
            updateAndRender();
        })
    </script>
